import React from 'react';
import styled from 'styled-components';

const SHome = styled.div`
  height: 100%;
`;

const TopBanner = styled.div`
  width: 100%;
  height: 30%;
`;
const LeftTopBanner = styled.div`
  width: 70%;
  height: 30%;
  float: left;
`;
const LeftTopBannerDiv1 = styled.div`
  width: 100%;
  height: 49.5%;
`;
const LeftTopBannerDiv2 = styled.div`
  width: 49.5%;
  float: left;
`;
const LeftTopBannerDiv3 = styled.div`
  display: inline-block;
  width: 49.5%;
`;
const RightTopBanner = styled.div`
  display: inline-block;
  width: 29%;
  height: 100%;

  & img {
    width: 100%;
    height: 100%;
  }
`;

const Home = () => {
  return (
    <SHome>
      <TopBanner>
        <LeftTopBanner>
          <LeftTopBannerDiv1>
            {/* <img src="https://placeimg.com/900/400/any" /> */}
          </LeftTopBannerDiv1>
          <LeftTopBannerDiv2>
            {/* <img src="https://placeimg.com/900/400/any" /> */}
          </LeftTopBannerDiv2>
          <LeftTopBannerDiv3>
            {/* <img src="https://placeimg.com/900/400/any" /> */}
          </LeftTopBannerDiv3>
        </LeftTopBanner>
        <RightTopBanner>
          <img src="https://placeimg.com/400/400/any" />
        </RightTopBanner>
      </TopBanner>
    </SHome>
  );
};

Home.getInitialProps = async context => {
  return true;
};

export default Home;
